import React, { Component } from 'react'
import { useState, useEffect } from 'react';
import axios from 'axios';
import '../App.css';

export const UserAuth = (props) => {
    const [ticketData, setTicketData] = useState(null);
    const [devloperId, inputDevId] = useState("");
    const [pass, inputPassword] = useState("");
    const handleInputDevId = (e) => {
        inputDevId(e.target.value);
    };
    const handleInputPass = (e) => {
        inputPassword(e.target.value);
    };
    // const callAPI  =()=>{
    //     setTimeout(callTheAPI, 1000);
    //     return 1;
    // }
    async function callAPI(){
        let res = await axios({
            url: 'http://localhost:8000/userAuth',
            method: 'post',
            timeout: 8000,
            headers: {
                'Content-Type': 'application/json',
            },
            data : { devId: devloperId,password:pass}
        })   
        // Don't forget to return something   
        return res
      }
    return (
        <div className="maincontainer">
        <div className="container-fluid">
            <div className="row no-gutter">

                <div className="col-md-6 d-none d-md-flex bg-image"></div>

                <div className="col-md-6 bg-light">
                    <div className="login d-flex align-items-center py-5">

                        <div className="container">
                            <div className="row">
                                <div className="col-lg-10 col-xl-7 mx-auto">
                                    <h3 className="display-4">Split login page!</h3>
                                    <p className="text-muted mb-4">Create a login split page using Reactjs & Bootstrap 5.</p>
                                    <form>
                                        <div className="mb-3">
                                            <input id="inputEmail" type="email" placeholder="Email address" required="" autoFocus="" class="form-control rounded-pill border-0 shadow-sm px-4" />
                                        </div>
                                        <div className="mb-3">
                                            <input id="inputPassword" type="password" placeholder="Password" required="" class="form-control rounded-pill border-0 shadow-sm px-4 text-primary" />
                                        </div>
                                        <div className="d-grid gap-2 mt-2">
                                        <button type="submit" class="btn btn-primary btn-block text-uppercase mb-2 rounded-pill shadow-sm">Sign in</button>
                                        </div>
                                    </form>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
      </div>
    )
}
